import React from "react";
import "./Services.css";

const services = [
  { name: "Piscina al aire libre", img: "piscina.jpg" },
  { name: "Estacionamiento", img: "parking.jpg" },
  { name: "Cocina equipada", img: "kitchen.jpg" },
  { name: "Baños modernos", img: "bathroom.jpg" },
  { name: "Parrilla disponible", img: "grill.jpg" },
];

const Services = () => {
  return (
    <div className="services">
      <h2>Características del Lugar</h2>
      <div className="services-grid">
        {services.map((service, index) => (
          <div className="service-card" key={index}>
            <img src={`/assets/${service.img}`} alt={service.name} />
            <h3>{service.name}</h3>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Services;
